def monotonic(l: list):
    """Return True is list elements are monotonically increasing or decreasing.
    >>> monotonic([1, 2, 4, 20])
    True
    >>> monotonic([1, 20, 4, 10])
    False
    >>> monotonic([4, 1, 0, -10])
    True
    """

    n = len(l)
    if n <= 1:
        return True

    # check if all elements are same
    if all(l[i] == l[i+1] for i in range(n-1)):
        return True

    # check if list is monotonically increasing or decreasing
    is_increasing = l[0] <= l[1]
    for i in range(1, n-1):
        if is_increasing:
            if l[i] > l[i+1]:
                return False
        else:
            if l[i] < l[i+1]:
                return False

    return True

